description:
Sea Beast (2008) Alternatieve titel: Troglodyte

Verenigde Staten
Horror
87 minuten

geregisseerd door Paul Ziller
met Corin Nemec, Miriam McDonald en Daniel Wisler

Een mysterieus iets uit de diepte van de oceaan komt plotseling aan land. Het wezen heeft niet langer de behoefte aan zeevoedsel, maar wel aan mensenvlees en valt dan ook een slaperig vissersdorpje aan. Als er dan ook nog eens een gigantische storm woedt in het dorpje, blijven er maar een paar overlevenden over om terug te vechten.


